// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "../interfaces/IStakingAdapter.sol";

/**
 * @notice Minimal ERC20 interface
 */
interface IERC20 {
    function approve(address spender, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
    function transfer(address to, uint256 amount) external returns (bool);
}

/**
 * @notice Moonwell mToken interface (native GLMR version - CEther-style)
 */
interface IMTokenNative {
    function mint() external payable; // CEther-style: amount = msg.value
    function redeem(uint256 redeemTokens) external returns (uint256);
    function redeemUnderlying(uint256 redeemAmount) external returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function exchangeRateStored() external view returns (uint256);
}

/**
 * @notice Moonwell Comptroller interface
 */
interface IComptroller {
    function claimReward(uint8 rewardType, address holder, address[] calldata mTokens) external;
}

/**
 * @title MoonwellAdapter
 * @notice Adapter for HabitTracker to create yield stakes in Moonwell on Moonbeam
 * @dev Supports native GLMR staking via mGLMR market
 * 
 * @dev Terminology:
 * - Yield Stake: User rewards from successful habits staked here (userStakes)
 * - Yield Rewards: Additional rewards generated from Moonwell (WELL tokens + supply APY)
 * 
 * @dev When user completes a habit successfully, their reward is sent here as a yield stake
 * to generate additional yield rewards over time
 */
contract MoonwellAdapter is IStakingAdapter {
    address public immutable mToken;        // mGLMR address
    address public immutable comptroller;   // Moonwell Comptroller
    address public immutable habitTracker;  // Only HabitTracker can call

    mapping(address => uint256) public userStakes; // Track per-user yield stakes (principal)

    event Staked(address indexed user, uint256 amount, uint256 mTokens);
    event Unstaked(address indexed user, uint256 amount, uint256 mTokens);
    event RewardsClaimed(address indexed user, uint256 amount);

    error OnlyHabitTracker();
    error MintFailed();
    error RedeemFailed();
    error InvalidAmount();

    modifier onlyHabitTracker() {
        if (msg.sender != habitTracker) revert OnlyHabitTracker();
        _;
    }

    /**
     * @param _mToken Moonwell mGLMR token address
     * @param _comptroller Moonwell Comptroller address
     * @param _habitTracker HabitTracker contract address
     */
    constructor(address _mToken, address _comptroller, address _habitTracker) {
        mToken = _mToken;
        comptroller = _comptroller;
        habitTracker = _habitTracker;
    }

    /**
     * @notice Create yield stake by staking user rewards into Moonwell
     * @param user Address of the user whose rewards are being staked
     * @param amount Amount of GLMR to stake (user's earned reward)
     * @dev msg.value must equal amount (native token)
     * @dev This converts user rewards into yield stakes that generate yield rewards
     */
    function stake(address user, uint256 amount) external payable onlyHabitTracker {
        if (msg.value != amount) revert InvalidAmount();
        if (amount == 0) revert InvalidAmount();

        // Mint mGLMR by sending GLMR (creates yield stake)
        IMTokenNative(mToken).mint{value: amount}();

        // Track user's yield stake (principal amount)
        userStakes[user] += amount;

        emit Staked(user, amount, IMTokenNative(mToken).balanceOf(address(this)));
    }

    /**
     * @notice Unstake GLMR from Moonwell (redeem yield stake + accumulated yield rewards)
     * @param user Address of the user whose rewards are being unstaked
     * @param amount Amount of underlying GLMR to unstake
     * @dev Redeems mGLMR and sends GLMR back to HabitTracker
     * @dev Returns both yield stake principal and any accumulated yield rewards
     */
    function unstake(address user, uint256 amount) external onlyHabitTracker {
        if (amount == 0) revert InvalidAmount();

        // Redeem underlying GLMR (yield stake + yield rewards)
        uint256 err = IMTokenNative(mToken).redeemUnderlying(amount);
        if (err != 0) revert RedeemFailed();

        // Update user's yield stake principal
        userStakes[user] -= amount;

        // Send GLMR back to HabitTracker (includes yield rewards if amount > principal)
        (bool success, ) = habitTracker.call{value: amount}("");
        if (!success) revert RedeemFailed();

        emit Unstaked(user, amount, IMTokenNative(mToken).balanceOf(address(this)));
    }

    /**
     * @notice Claim yield rewards (WELL tokens) from Moonwell
     * @return claimed Amount of yield rewards claimed (0 if none)
     * @dev Best-effort claim; returns 0 if rewards not active
     * @dev Yield rewards = WELL tokens earned from supplying to Moonwell
     */
    function claimRewards() external onlyHabitTracker returns (uint256 claimed) {
        address[] memory markets = new address[](1);
        markets[0] = mToken;

        // Try to claim WELL yield rewards (rewardType 0)
        try IComptroller(comptroller).claimReward(0, address(this), markets) {
            // If successful, WELL yield rewards sent to this adapter
            // HabitTracker can sweep them later
            emit RewardsClaimed(msg.sender, 0);
            return 0; // Don't track WELL tokens for now
        } catch {
            return 0; // Yield rewards not active or failed
        }
    }

    /**
     * @notice Get user's yield stake amount (in underlying GLMR)
     * @param who Address to check
     * @return staked Amount of GLMR in yield stake (principal only, excludes yield rewards)
     */
    function getStakedAmount(address who) external view returns (uint256 staked) {
        // Return user's tracked yield stake principal
        // Note: This tracks only principal, not current value including yield rewards
        return userStakes[who];
    }

    /**
     * @notice Get pending yield rewards (not supported by Moonwell directly)
     * @return pending Always returns 0
     * @dev Moonwell doesn't expose claimable yield rewards on-chain; use off-chain calculation
     * @dev Yield rewards accumulate automatically in mToken exchange rate
     */
    function getPendingRewards(address /* who */) external pure returns (uint256 pending) {
        return 0; // Not easily accessible on-chain
    }

    /**
     * @notice Allow receiving GLMR from Moonwell redemptions
     */
    receive() external payable {}
}

contracts/HabitTracker.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "./interfaces/IStakingAdapter.sol";

/**
 * @title HabitTracker
 * @notice Gamified habit tracking with financial commitment and yield generation
 * @dev Uses epoch-based time (86400-second days) for daily cycles
 * @dev Integrates with external staking via IStakingAdapter
 * 
 * @dev Two types of stakes:
 * - Funded Stake: User deposits locked during day (blockedBalance)
 * - Yield Stake: Successful rewards staked externally for yield generation
 * 
 * @dev Two types of rewards:
 * - User Rewards: Base rewards from successful habit completion (claimableBalance)
 * - Yield Rewards: Additional rewards generated from external staking (tracked in adapter)
 * 
 * @author HabitChain Team
 */
contract HabitTracker {
    uint256 public constant STAKE_PER_DAY = 10 ether;
    uint256 private constant SECONDS_PER_DAY = 86400;
    address public immutable treasury;
    IStakingAdapter public stakingAdapter;
    address public owner;

    // Balance type identifiers
    uint8 private constant BALANCE_DEPOSIT = 0;
    uint8 private constant BALANCE_CLAIMABLE = 1;
    uint8 private constant BALANCE_EXTERNAL = 2;

    // ============ Structs ============

    struct UserState {
        uint256 depositBalance;      // Available funds for staking on habits
        uint256 blockedBalance;      // Funded stake: locked during active day
        uint256 claimableBalance;    // User rewards: earned from successful habits
        uint32 activeHabitCount;
    }

    struct Habit {
        bytes32 text;
        uint64 createdAtEpoch;
        bool archived;
    }

    mapping(address => UserState) public userStates;
    mapping(address => mapping(uint32 => Habit)) public habits;
    mapping(address => uint32) public userHabitCounters;

    // Bitmap storage: each bit represents a habitId (supports 256 habits per user per epoch)
    mapping(address => mapping(uint64 => uint256)) public funded;
    mapping(address => mapping(uint64 => uint256)) public checked;
    mapping(address => mapping(uint64 => uint256)) public settled;

    event Deposited(address indexed user, uint256 amount);
    event BalanceMoved(address indexed user, uint8 indexed from, uint8 indexed to, uint256 amount);
    event HabitCreated(address indexed user, uint32 indexed habitId, bytes32 text);
    event HabitArchived(address indexed user, uint32 indexed habitId);
    event DayPrepared(address indexed user, uint64 indexed epoch, uint32 fundedCount, uint32 insufficientCount);
    event CheckedIn(address indexed user, uint32 indexed habitId, uint64 indexed epoch);
    event SettledSuccess(address indexed user, uint32 indexed habitId, uint64 indexed epoch, uint256 reward);
    event SettledFail(address indexed user, uint32 indexed habitId, uint64 indexed epoch, uint256 slashed);
    event StakingAdapterUpdated(address indexed oldAdapter, address indexed newAdapter);

    error InvalidTreasury();
    error InvalidAmount();
    error InsufficientBalance();
    error InvalidBalanceType();
    error HabitNotFound();
    error HabitAlreadyArchived();
    error InvalidEpoch();
    error DayNotFunded();
    error AlreadyCheckedIn();
    error AlreadySettled();
    error CannotSettleCurrentDay();
    error TransferFailed();
    error HabitTextTooLong();
    error OnlyOwner();
    error InvalidStakingAdapter();
    error HabitIdTooLarge();

    modifier onlyOwner() {
        if (msg.sender != owner) revert OnlyOwner();
        _;
    }

    // ============ Constructor ============

    constructor(address _treasury, address _stakingAdapter) {
        if (_treasury == address(0)) revert InvalidTreasury();
        treasury = _treasury;
        owner = msg.sender;

        // Staking adapter is optional - can be address(0) initially
        if (_stakingAdapter != address(0)) {
            stakingAdapter = IStakingAdapter(_stakingAdapter);
        }
    }

    function epochNow() public view returns (uint64) {
        return uint64(block.timestamp / SECONDS_PER_DAY);
    }

    // ============ Admin Functions ============

    function setStakingAdapter(address _newAdapter) external onlyOwner {
        if (_newAdapter == address(0)) revert InvalidStakingAdapter();
        address oldAdapter = address(stakingAdapter);
        stakingAdapter = IStakingAdapter(_newAdapter);
        emit StakingAdapterUpdated(oldAdapter, _newAdapter);
    }

    function transferOwnership(address newOwner) external onlyOwner {
        if (newOwner == address(0)) revert InvalidTreasury();
        owner = newOwner;
    }

    // ============ Balance Management ============

    function deposit() external payable {
        if (msg.value == 0) revert InvalidAmount();
        userStates[msg.sender].depositBalance += msg.value;
        emit Deposited(msg.sender, msg.value);
    }

    /**
     * @notice Move funds between balance types
     * @param from Source balance type (0=deposit, 1=claimable)
     * @param to Destination balance type (0=deposit, 1=claimable, 2=external/withdraw)
     * @param amount Amount to move
     * @dev Examples: withdraw from deposit: move(0,2,amt), claim: move(1,2,amt), redeposit: move(1,0,amt)
     */
    function move(uint8 from, uint8 to, uint256 amount) external {
        if (amount == 0) revert InvalidAmount();
        if (from == to) revert InvalidBalanceType();
        if (from > BALANCE_CLAIMABLE || to > BALANCE_EXTERNAL) revert InvalidBalanceType();

        UserState storage state = userStates[msg.sender];

        // Deduct from source
        if (from == BALANCE_DEPOSIT) {
            if (state.depositBalance < amount) revert InsufficientBalance();
            unchecked { state.depositBalance -= amount; }
        } else { // BALANCE_CLAIMABLE
            if (state.claimableBalance < amount) revert InsufficientBalance();
            unchecked { state.claimableBalance -= amount; }
        }

        // Add to destination
        if (to == BALANCE_DEPOSIT) {
            unchecked { state.depositBalance += amount; }
        } else if (to == BALANCE_CLAIMABLE) {
            unchecked { state.claimableBalance += amount; }
        } else { // BALANCE_EXTERNAL
            _transfer(msg.sender, amount);
        }

        emit BalanceMoved(msg.sender, from, to, amount);
    }

    function _transfer(address to, uint256 amount) private {
        (bool success, ) = to.call{value: amount}("");
        if (!success) revert TransferFailed();
    }

    // ============ Habit Management Functions ============

    /**
     * @notice Create a new habit
     * @param text Description of the habit (up to 32 bytes)
     * @return habitId The ID of the newly created habit
     */
    function createHabit(bytes32 text) external returns (uint32) {
        if (text == bytes32(0)) revert HabitTextTooLong();

        uint32 habitId = ++userHabitCounters[msg.sender];
        if (habitId > 255) revert HabitIdTooLarge(); // Bitmap limit

        habits[msg.sender][habitId] = Habit({
            text: text,
            createdAtEpoch: epochNow(),
            archived: false
        });

        unchecked { userStates[msg.sender].activeHabitCount++; }

        emit HabitCreated(msg.sender, habitId, text);
        return habitId;
    }

    /**
     * @notice Archive a habit (soft delete)
     * @param habitId ID of the habit to archive
     */
    function archiveHabit(uint32 habitId) external {
        Habit storage habit = habits[msg.sender][habitId];
        if (habit.createdAtEpoch == 0) revert HabitNotFound();
        if (habit.archived) revert HabitAlreadyArchived();
        habit.archived = true;
        unchecked { userStates[msg.sender].activeHabitCount--; }
        emit HabitArchived(msg.sender, habitId);
    }

    // ============ Daily Cycle Functions ============

    /**
     * @notice Prepare the day by locking funds (funded stake) for active habits
     * @param epoch The epoch to prepare (must be current day)
     * @dev Moves funds from depositBalance to blockedBalance (funded stake)
     */
    function prepareDay(uint64 epoch) external {
        if (epoch != epochNow()) revert InvalidEpoch();

        UserState storage state = userStates[msg.sender];
        uint32 count = userHabitCounters[msg.sender];
        uint32 fundedCount;
        uint32 insufficientCount;
        uint256 fundedBitmap = funded[msg.sender][epoch];

        for (uint32 i = 1; i <= count;) {
            Habit storage habit = habits[msg.sender][i];

            if (!habit.archived && habit.createdAtEpoch != 0) {
                uint256 mask = 1 << i;

                if (fundedBitmap & mask == 0) { // Check if not already funded
                    if (state.depositBalance >= STAKE_PER_DAY) {
                        unchecked {
                            state.depositBalance -= STAKE_PER_DAY;
                            state.blockedBalance += STAKE_PER_DAY; // Funded stake
                            fundedCount++;
                        }
                        fundedBitmap |= mask; // Set funded bit
                    } else {
                        unchecked { insufficientCount++; }
                    }
                }
            }
            unchecked { i++; }
        }

        funded[msg.sender][epoch] = fundedBitmap;
        emit DayPrepared(msg.sender, epoch, fundedCount, insufficientCount);
    }

    /**
     * @notice Check in to a habit for the current day
     * @param habitId ID of the habit
     * @param epoch The epoch to check in (must be current day)
     */
    function checkIn(uint32 habitId, uint64 epoch) external {
        if (epoch != epochNow()) revert InvalidEpoch();
        Habit storage habit = habits[msg.sender][habitId];
        if (habit.createdAtEpoch == 0 || habit.archived) revert HabitNotFound();

        uint256 mask = 1 << habitId;
        if (funded[msg.sender][epoch] & mask == 0) revert DayNotFunded();
        if (checked[msg.sender][epoch] & mask != 0) revert AlreadyCheckedIn();

        checked[msg.sender][epoch] |= mask;
        emit CheckedIn(msg.sender, habitId, epoch);
    }

    /**
     * @notice Settle a specific habit for a past day
     * @param user Address of habit owner
     * @param epoch The epoch to settle (must be past day)
     * @param habitId ID of the habit to settle
     */
    function settle(address user, uint64 epoch, uint32 habitId) public {
        if (epoch >= epochNow()) revert CannotSettleCurrentDay();
        _settleInternal(user, epoch, habitId);
    }

    /**
     * @notice Force settle a specific habit without epoch validation (TESTING ONLY)
     * @dev Bypasses the "cannot settle current day" check - use with caution
     * @param user Address of habit owner
     * @param epoch The epoch to settle (can be any epoch, including current)
     * @param habitId ID of the habit to settle
     */
    function forceSettle(address user, uint64 epoch, uint32 habitId) public {
        _settleInternal(user, epoch, habitId);
    }

    /**
     * @notice Internal settlement logic without epoch validation
     * @param user Address of habit owner
     * @param epoch The epoch to settle
     * @param habitId ID of the habit to settle
     * @dev Settlement flow:
     * - SUCCESS: User reward is staked externally (yield stake) to generate yield rewards
     * - FAIL: Funded stake is sent to treasury (slashed)
     */
    function _settleInternal(address user, uint64 epoch, uint32 habitId) private {
        if (habits[user][habitId].createdAtEpoch == 0) revert HabitNotFound();

        uint256 mask = 1 << habitId;
        if (funded[user][epoch] & mask == 0) revert DayNotFunded();
        if (settled[user][epoch] & mask != 0) revert AlreadySettled();

        settled[user][epoch] |= mask;
        UserState storage state = userStates[user];

        // Release funded stake from blocked balance
        if (state.blockedBalance < STAKE_PER_DAY) revert InsufficientBalance();
        unchecked { state.blockedBalance -= STAKE_PER_DAY; }

        if (checked[user][epoch] & mask != 0) {
            // SUCCESS: Create yield stake by staking user rewards externally
            // This generates yield rewards on top of the base user reward
            if (address(stakingAdapter) != address(0)) {
                stakingAdapter.stake{value: STAKE_PER_DAY}(user, STAKE_PER_DAY);
            } else {
                // Fallback: add user reward to claimable balance (no yield generation)
                unchecked { state.claimableBalance += STAKE_PER_DAY; }
            }
            emit SettledSuccess(user, habitId, epoch, STAKE_PER_DAY);
        } else {
            // FAIL: Slash funded stake - send to treasury
            _transfer(treasury, STAKE_PER_DAY);
            emit SettledFail(user, habitId, epoch, STAKE_PER_DAY);
        }
    }

    // ============ Receive Function ============

    /**
     * @notice Allow receiving native tokens from staking adapter
     */
    receive() external payable {}
}

contracts/interfaces/IStakingAdapter.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

/**
 * @title IStakingAdapter
 * @notice Chain-agnostic interface for external staking protocols
 * @dev Allows HabitTracker to integrate with any staking protocol
 * 
 * @dev Terminology:
 * - Yield Stake: User rewards staked in external protocol (principal)
 * - Yield Rewards: Additional rewards generated from external protocol
 */
interface IStakingAdapter {
    /**
     * @notice Create yield stake by staking user rewards into external protocol
     * @param user Address of the user whose rewards are being staked
     * @param amount Amount to stake (user's earned rewards)
     * @dev For native token staking, msg.value should equal amount
     */
    function stake(address user, uint256 amount) external payable;

    /**
     * @notice Unstake from external protocol (yield stake + yield rewards)
     * @param user Address of the user whose rewards are being unstaked
     * @param amount Amount to unstake
     * @dev Unstaked tokens (principal + yield rewards) should be sent back to HabitTracker
     */
    function unstake(address user, uint256 amount) external;

    /**
     * @notice Claim accumulated yield rewards from external protocol
     * @return claimed Amount of yield rewards claimed
     * @dev Returns 0 if no yield rewards available or not supported
     */
    function claimRewards() external returns (uint256 claimed);

    /**
     * @notice Get total yield stake amount for an address (principal only)
     * @param who Address to check
     * @return staked Total yield stake by address (excludes yield rewards)
     */
    function getStakedAmount(address who) external view returns (uint256 staked);

    /**
     * @notice Get pending unclaimed yield rewards for an address
     * @param who Address to check
     * @return pending Pending yield rewards
     * @dev Returns 0 if not supported by protocol
     */
    function getPendingRewards(address who) external view returns (uint256 pending);
}

contracts/mocks/MockStakingRewards.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "../interfaces/IStakingAdapter.sol";

/**
 * @title MockStakingRewards
 * @notice Simple mock staking contract for testing on Passet Hub
 * @dev Linear reward rate: rewards = staked * ratePerSecond * timeStaked
 */
contract MockStakingRewards is IStakingAdapter {
    uint256 public immutable ratePerSecond; // Reward rate per second (in wei per 1e18 staked)
    address public immutable habitTracker;

    mapping(address => uint256) public deposits;
    mapping(address => uint256) public lastUpdateTime;

    event Staked(address indexed user, uint256 amount);
    event Unstaked(address indexed user, uint256 amount);
    event RewardsClaimed(address indexed user, uint256 amount);

    error OnlyHabitTracker();
    error InsufficientBalance();
    error TransferFailed();
    error InvalidAmount();

    modifier onlyHabitTracker() {
        if (msg.sender != habitTracker) revert OnlyHabitTracker();
        _;
    }

    /**
     * @param _ratePerSecond Reward rate (e.g., 1e15 = 0.1% per second)
     * @param _habitTracker HabitTracker contract address
     */
    constructor(uint256 _ratePerSecond, address _habitTracker) {
        ratePerSecond = _ratePerSecond;
        habitTracker = _habitTracker;
    }

    function stake(address user, uint256 amount) external payable onlyHabitTracker {
        if (msg.value != amount) revert InvalidAmount();
        if (amount == 0) revert InvalidAmount();

        _updateRewards(user);
        deposits[user] += amount;

        emit Staked(user, amount);
    }

    function unstake(address user, uint256 amount) external onlyHabitTracker {
        if (amount == 0) revert InvalidAmount();
        if (deposits[user] < amount) revert InsufficientBalance();

        _updateRewards(user);
        deposits[user] -= amount;

        // Send back to HabitTracker
        (bool success, ) = habitTracker.call{value: amount}("");
        if (!success) revert TransferFailed();

        emit Unstaked(user, amount);
    }

    function claimRewards() external onlyHabitTracker returns (uint256 claimed) {
        claimed = _pendingRewards(msg.sender);

        // Safety: Check contract has funds
        uint256 balance = address(this).balance;
        if (balance == 0) return 0;

        // Safety: Cap at 10% of balance per claim
        uint256 maxClaim = balance / 10;
        if (claimed > maxClaim) claimed = maxClaim;

        // Safety: Can only claim what's available
        if (claimed > balance) claimed = balance;

        if (claimed > 0) {
            lastUpdateTime[msg.sender] = block.timestamp;
            (bool success, ) = habitTracker.call{value: claimed}("");
            if (!success) revert TransferFailed();
            emit RewardsClaimed(msg.sender, claimed);
        }

        return claimed;
    }

    function getStakedAmount(address who) external view returns (uint256) {
        return deposits[who];
    }

    function getPendingRewards(address who) external view returns (uint256) {
        return _pendingRewards(who);
    }

    function getContractBalance() external view returns (uint256) {
        return address(this).balance;
    }

    function _updateRewards(address user) internal {
        if (lastUpdateTime[user] == 0) {
            lastUpdateTime[user] = block.timestamp;
        }
    }

    function _pendingRewards(address user) internal view returns (uint256) {
        if (lastUpdateTime[user] == 0 || deposits[user] == 0) {
            return 0;
        }

        uint256 timeElapsed = block.timestamp - lastUpdateTime[user];
        // rewards = staked * ratePerSecond * timeElapsed / 1e18
        return (deposits[user] * ratePerSecond * timeElapsed) / 1e18;
    }

    /**
     * @notice Allow receiving PAS for reward pool
     */
    receive() external payable {}
}

